// Extrair o corpo do webhook
const body = $node["Loop Over Items"].json || null;

// Verificar se o corpo do webhook existe e não está vazio
if (!body || Object.keys(body).length === 0) {
    // Se o corpo estiver ausente, vazio ou nulo, trava a execução
    return [];
}

// Extrair o payload e as respostas do webhook
const payload = body || null;
const responses = payload || null;

// Verificar se o payload existe e não está vazio
if (!payload || Object.keys(payload).length === 0) {
    return [];
}

// Extrair valores das respostas, garantindo que não quebrem caso estejam ausentes
const titulo = responses?.["SOFTWARE"] || "";
const gestor = responses?.["GESTOR"].replace(/^\d+\s*/, '') || "";
const emailAnswer = responses?.["EMAIL"] || "";
const whatsappInput = responses?.["TELEFONE"] || "";
const inicio = responses?.["INICIO"] || "";
const identificacao = responses?.["IDENTIFICAÇÃO"] || "";
const cnpj = responses?.["CNPJ"] || "";
const dt_vencimento_assinatura = responses?.["VENCIMENTO ASSINATURA"] || "";
const valor_assinatura = responses?.["VALOR"] || "";
const dt_vencimento_mentoria = responses?.["VENCIMENTO MENTORIA "] || "";


// Função para formatar email
function formatEmail(email) {
    return email ? email.toLowerCase().trim() : '';
}

// Função para formatar número de WhatsApp, retornando null se não existir
function formatWhatsApp(number) {
    if (!number) return null;

    // Remover todos os caracteres não numéricos
    let whatsapp = number.toString().replace(/\D/g, '');

    // Retornar null se não houver dígitos
    if (!whatsapp) return null;

    // Adicionar código do país se necessário
    if (!whatsapp.startsWith('55')) {
        whatsapp = '55' + whatsapp;
    }

    // Remover o código do país para processamento
    whatsapp = whatsapp.slice(2);

    // Obter DDD e número
    const ddd = whatsapp.slice(0, 2);
    let phoneNumber = whatsapp.slice(2);

    // Verificar se o número tem o tamanho mínimo
    if (phoneNumber.length < 8) {
        return null;
    }

    // Converter DDD para número inteiro
    const dddInt = parseInt(ddd, 10);

    // Lógica para ajustar o número com base no DDD e no comprimento
    if (dddInt > 27) {
        // Se o DDD for maior que 27 e o número tiver 9 dígitos, remover o primeiro dígito
        if (phoneNumber.length >= 9) {
            phoneNumber = phoneNumber.slice(1);
        }
        // Não adicionar '9' para DDDs maiores que 27
    } else {
        // Para DDDs de 11 a 27, garantir que o número tenha 9 dígitos
        if (phoneNumber.length === 8) {
            phoneNumber = '9' + phoneNumber;
        }
    }

    // Reconstituir o número completo com o código do país
    whatsapp = '55' + ddd + phoneNumber;

    return whatsapp;
}

// Obter dados formatados
const formattedEmail = formatEmail(emailAnswer);
const formattedWhatsApp = formatWhatsApp(whatsappInput);

// Construir o objeto de resultado
const result = {
    titulo: titulo,
    nome: gestor,
    inicio: inicio,
    identificacao: identificacao,
    telefone: formattedWhatsApp,
    email: formattedEmail,
    cnpj: cnpj,
    dt_vencimento_assinatura: dt_vencimento_assinatura,
    valor_assinatura: valor_assinatura,
    dt_vencimento_mentoria: dt_vencimento_mentoria

};

// Retornar o resultado no formato que o n8n espera
return [{ json: result }];
